/*Table structure for table `comment` */

DROP TABLE IF EXISTS `comment`;

CREATE TABLE `comment` (
  `comment_id` bigint(20) NOT NULL COMMENT '评论id',
  `goods_id` bigint(20) NOT NULL COMMENT '商品id',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `business_id` bigint(20) NOT NULL COMMENT '商户id',
  `content` text NOT NULL COMMENT '评论内容',
  `like_num` int(11) unsigned DEFAULT '0' COMMENT '点赞数',
  `is_have_image` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否有图片',
  `update_by` varchar(64) NOT NULL COMMENT '修改人',
  `create_by` varchar(64) NOT NULL COMMENT '创建人',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `star` tinyint(2) NOT NULL DEFAULT '0',
  PRIMARY KEY (`comment_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `comment` */

insert  into `comment`(`comment_id`,`goods_id`,`user_id`,`business_id`,`content`,`like_num`,`is_have_image`,`update_by`,`create_by`,`update_time`,`create_time`,`star`) values (2,1622128490642411522,1649796123411992578,1,'{\"info\":\"非常好的蔬菜，爱来自中国\",\"images\":[\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F9aD1nnQSrezrcFKGaDbZz1xlbUZ9ZPy7xTMMrQuOI9U9T1515510861529.jpg&thumbnail=660x2147483647&quality=80&type=jpg\",\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2FEXNIPyrCCRnTctrSZFtxJacns%3DWYO605v%3DzYAYFjfPdmc1515510861528.jpg&thumbnail=660x2147483647&quality=80&type=jpg\"]}',10,1,'admin','admin','2023-04-19 19:56:48','2023-04-19 19:56:50',4),(3,1622128490642411522,1649796123411992578,1,'{\"info\":\"我是白菜，白菜好吃\",\"images\":[]}',10,0,'wwwwz','wwwwz','2023-04-12 20:34:14','2023-04-12 20:34:18',5);

/*Table structure for table `goods` */

DROP TABLE IF EXISTS `goods`;

CREATE TABLE `goods` (
  `goods_id` bigint(20) NOT NULL COMMENT '商品id',
  `business_id` bigint(20) NOT NULL COMMENT '商家id',
  `grade_id` bigint(20) NOT NULL COMMENT '等级id',
  `goods_name` varchar(64) NOT NULL COMMENT '商品名',
  `stock` bigint(20) NOT NULL DEFAULT '0' COMMENT '库存',
  `sales` bigint(20) NOT NULL DEFAULT '0' COMMENT '商品销量',
  `goods_image` text COMMENT '商品展示图',
  `description` varchar(255) DEFAULT NULL COMMENT '商品介绍',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '起售状态',
  `update_by` varchar(64) NOT NULL COMMENT '修改人',
  `create_by` varchar(64) NOT NULL COMMENT '创建人',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`goods_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

